import logo1 from "../icons/gologo.png";

function Content_Homepage() {
  return (
    <div className="flex w-2/3 h-96 bg-slate-300 mx-auto">
      <div className="flex">
        <div>
          Para crear un backend rapido y facil de mantener este es mi preferido
        </div>
        <div>
            <img className="h-9" src={logo1}></img>
        </div>
      </div>
    </div>
  );
}

export default Content_Homepage;
